import React from 'react'

class Car extends React.Component {
    constructor() {
        super()
        this.state = {
            brand: "Ford",
            model: "Mustang",
            color: "Red",
            year: 1964
        }
    }

    render() {
        return (
            <>
                <h2>Je suis une voiture</h2>
            </>
        )
    }
}

export default Car
